INSERT INTO `sys_oper_log` VALUES (523, '离校注意事项公告', 1, 'com.stu.air.controller.DeparturenoticesController.add()', 'POST', 1, 'adminroot', NULL, '/air/departurenoticesxf', '127.0.0.1', '内网IP', '{\"content\":\"各学院：\\n\\n为做好2023届毕业生离校工作，确保毕业生顺利离校和学校资产管理有序，现就有关事项通知如下：\\n\\n一、毕业生住宿房间钥匙和空调遥控器回收。各学院应通知毕业生，离校时，以班级为单位上交钥匙和空调遥控器，交齐后，我处方在离校单盖章（公寓管理专用章）；已经离校没有上交钥匙的，应通知毕业生将钥匙寄回。收缴的钥匙和遥控器，以班级为单位，分别交相山、滨湖公寓管理科。\\n\\n凡上缴不齐的，所发生的费用，由学院承担。\\n\\n学生离校盖章处： 相山校区学生公寓5#值班室\\n\\n滨湖校区行政办公楼南楼101室\\n\\n二、毕业生房间空调遥控器和方凳查验。毕业生离校时，应将房间方凳放至各自书桌下方，有序摆放，以便物管人员查验。\\n\\n凡缺失的，由相关责任人自行配齐或赔偿。\\n\\n三、毕业生房间验收时间为5月29日至6月2日。\\n\\n四、 公寓管理科离校手续办理时间为6月5日至6月13日，以班级为单位集中办理。\\n\\n特此通知。\\n\\n \\n\\n  后勤服务与管理处\\n\\n 2023年5月26日\\n\\n\",\"noticeID\":1,\"params\":{},\"publishDate\":\"2023-05-06\",\"title\":\"关于2023届毕业生离校有关事项的通知\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2023-06-03 04:20:43', 45);
